import React from "react";
import { useRouter } from "next/router";

import Layout from "../../../components/Layout";

const Post = () => {
  const router = useRouter();
  const { query } = router.query;

  return (
    <React.Fragment>
      <Layout>{query}</Layout>
    </React.Fragment>
  );
};

export default Post;
